export async function fetchMovieTitles() {
    try {
        const response = await fetch('http://localhost:8000/movies/titles/');
        if (!response.ok) throw new Error('Network response was not ok.');
        return await response.json();
    } catch (error) {
        console.error('Error fetching movie titles:', error);
        throw error;
    }
}

export async function fetchRecommendations(title) {
    try {
        const response = await fetch(`http://localhost:8000/movies/recommend/${encodeURIComponent(title)}/`);
        if (!response.ok) throw new Error('Network response was not ok.');
        return await response.json();
    } catch (error) {
        console.error('Error fetching movie recommendations:', error);
        throw error;
    }
}
